import React, { useState } from "react";
import { useAuth } from "../context/AuthContext";
import { companyService } from "../services/api";
import { useNavigate } from "react-router-dom";

const CompanySetup = () => {
  const [formData, setFormData] = useState({
    name: "",
    description: "",
    industry: "",
    size: "",
    vision: "",
    mission: "",
    values: "",
  });

  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [apiKey, setApiKey] = useState("");
  const [apiUrl, setApiUrl] = useState("");

  const { user } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");

    try {
      const valuesArray = formData.values
        .split(",")
        .map((v) => v.trim())
        .filter((v) => v);

      const companyData = { ...formData, values: valuesArray };
      const response = await companyService.updateCompany(companyData);
      const company = response.data || response;

      if (company.apiKey) {
        setApiKey(company.apiKey);

        const backendUrl =
          (typeof import.meta !== "undefined" &&
            import.meta.env &&
            import.meta.env.VITE_API_URL) ||
          "http://localhost:5000/api";

        setApiUrl(`${backendUrl}/company/use-model`);
      } else {
        setError("API Key not found for this company");
      }
    } catch (error) {
      console.error("❌ Company setup error:", error);
      setError(error.response?.data?.error || "An error occurred while saving");
    } finally {
      setLoading(false);
    }
  };

  // Success state
  if (apiKey && apiUrl) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-500 via-purple-500 to-pink-500 px-6 py-10">
        <div className="max-w-lg w-full bg-white p-8 rounded-2xl shadow-xl border border-gray-100">
          <h2 className="text-3xl font-bold text-center text-blue-700 mb-6">
            🎉 Company Created Successfully!
          </h2>

          <div className="space-y-4">
            <div className="bg-gray-100 p-3 rounded-md text-sm">
              <strong>API URL:</strong>
              <p className="break-all text-gray-700">{apiUrl}</p>
            </div>

            <div className="bg-gray-100 p-3 rounded-md text-sm">
              <strong>API Key:</strong>
              <p className="break-all text-gray-700">{apiKey}</p>
            </div>

            <p className="text-gray-600 text-sm text-center">
              Use this API URL and Key to integrate AI features with your
              company.
            </p>

            <div className="text-center mt-6">
              <button
                onClick={() => navigate("/dashboard")}
                className="bg-gradient-to-r from-blue-600 to-pink-500 text-white py-2 px-6 rounded-lg hover:opacity-90 transition"
              >
                Back to Dashboard
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }

  // Setup form
  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-500 via-purple-500 to-pink-500 px-6 py-10">
      <div className="max-w-lg w-full bg-white p-8 rounded-2xl shadow-xl border border-gray-100">
        <h2 className="text-3xl font-bold text-center text-blue-700 mb-6">
          Company Setup
        </h2>

        <form onSubmit={handleSubmit} className="space-y-4">
          {[
            { name: "name", placeholder: "Company Name", type: "input" },
            { name: "description", placeholder: "Company Description", type: "textarea" },
            { name: "industry", placeholder: "Industry", type: "input" },
            { name: "size", placeholder: "Company Size", type: "input" },
            { name: "vision", placeholder: "Vision", type: "textarea" },
            { name: "mission", placeholder: "Mission", type: "textarea" },
            {
              name: "values",
              placeholder: "Values (comma separated)",
              type: "input",
            },
          ].map((field) =>
            field.type === "textarea" ? (
              <textarea
                key={field.name}
                name={field.name}
                placeholder={field.placeholder}
                value={formData[field.name]}
                onChange={handleChange}
                className="w-full p-3 border rounded-md focus:ring-2 focus:ring-blue-400 focus:outline-none"
                required={["name", "description"].includes(field.name)}
              />
            ) : (
              <input
                key={field.name}
                name={field.name}
                placeholder={field.placeholder}
                value={formData[field.name]}
                onChange={handleChange}
                className="w-full p-3 border rounded-md focus:ring-2 focus:ring-blue-400 focus:outline-none"
                required={["name", "description"].includes(field.name)}
              />
            )
          )}

          {error && (
            <p className="text-red-600 text-center text-sm font-medium">
              {error}
            </p>
          )}

          <button
            type="submit"
            disabled={loading}
            className="w-full bg-gradient-to-r from-blue-600 to-pink-500 text-white py-3 rounded-md font-semibold hover:opacity-90 transition"
          >
            {loading ? "Saving..." : "💾 Save Company"}
          </button>
        </form>
      </div>
    </div>
  );
};

export default CompanySetup;
